import React from 'react';
import './App.css';


const App = () => {
  return (
    <div className='app-wrapper'>
      <header className='header'>
        <img src='https://www.logofound.com/wp-content/uploads/2017/06/abstract-logo-template-11-02.jpg'></img>
      </header>
      <nav className='nav'>
        <div>
          Profile
        </div>
        <div>
          Messages
         </div>
      </nav>
      <div className='content'>
        Main Content
      </div>


    </div>);
}

export default App;
